#include<bits/stdc++.h>
using namespace std;

string solve() {
    int n, k;
    cin >> n >> k;

    int arr[n];
    for (int i = 0; i < n; i++) {
        cin >> arr[i];
    }

    int var = 0;
    for (int i = 0; i < n; i++) {
        if (arr[i] <= 0) {
            var++;
        }
    }

    if (var >= k)
        return "Qizg'in";
    return "Zerikarli";

}

int main()
{

    int t;
    cin >> t;

    while (t--)
        cout << solve() << endl;


    return 0;
}
